import React from 'react';
import { TabMenu } from 'primereact/tabmenu';
import Branch from './Branch';

const links = [
  { label: 'Branch', icon: 'pi pi-fw pi-file', component: <Branch /> },
  { label: 'Brand', href: '/Brand' },
  { label: 'Category', href: '/Category' },
  { label: 'Department', href: '/Department' },
  { label: 'DeviceStatus', href: '/DeviceStatus' },
];

function Menu() {
  return (
    <div>
      <TabMenu model={links} className="text-lg text-indigo-700" />
    </div>
  );
}

export default Menu;
